import React, { useState } from 'react';

const App1 = () => {

    const [name, setName] = useState("");
    const [val, setVal] = useState("");

    const fetchData = async() => {
        const result = await fetch(`https://api.github.com/users/${val}`);
        const colectData = await result.json();
        console.log(colectData);
        setName(colectData);
        setVal("");       
    }

    const newEvent = (e) => {
        setVal(e.target.value);
    }


  return (
    <div>
      <div>
          <h1>Login: {name.login}</h1>
          <h2>User Id: {name.id}</h2>
          <input type="text" onChange={newEvent}/>
          <button onClick={fetchData}>Add</button>
      </div>
    </div>
  )
}

export default App1
